import { LGOIN_USER } from '../_actions/types';

// eslint-disable-next-line import/no-anonymous-default-export
export default function (state = {}, action) {
  switch (action.type) {
    case LGOIN_USER:
      return { ...state, loginSuccess: action.payload };
    default:
      return state;
  }
}
